import React from 'react';
import './Table.css';

export default function Table({ passCourses, suggestedSubjects }) {
  // Remove duplicates (in case a subject is in both lists)
  const uniqueSuggested = suggestedSubjects.filter(
    subject => !passCourses.includes(subject)
  );

  return (
    <div className="table-wrapper">
      <h3>âœ… Passed Subjects</h3>
      <table className="styled-table">
        <thead>
          <tr>
            <th>Subject Code</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {passCourses.length === 0 ? (
            <tr>
              <td colSpan="2">No passed subjects.</td>
            </tr>
          ) : (
            passCourses.map((subject, index) => (
              <tr key={index} className="green-row">
                <td>{subject}</td>
                <td>âœ… Passed</td>
              </tr>
            ))
          )}
        </tbody>
      </table>

      <h3>ðŸ’¡ Subjects Suggested for Registration</h3>
      <table className="styled-table">
        <thead>
          <tr>
            <th>Subject Code</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {uniqueSuggested.length === 0 ? (
            <tr>
              <td colSpan="2">No suggested subjects.</td>
            </tr>
          ) : (
            uniqueSuggested.map((subject, index) => (
              <tr key={index} className="black-row">
                <td>{subject}</td>
                <td>ðŸ’¡ Suggested</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}
